import React from 'react'
import Button,{ButtonSize,ButtonType} from './components/Button/button';
import MenuItem from './components/Menu/menuItem';
import Menu from './components/Menu/menu';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Menu defaultIndex={0} onSelect={(index) => {alert(index);
        }}>
          <MenuItem index={0}>
          cool link1
          </MenuItem>
          <MenuItem  index={1}>
          cool link2
          </MenuItem>
          <MenuItem  index={2}>
          cool link3
          </MenuItem>
        </Menu>
      <Button  btnType={ButtonType.Default}> Default test</Button>
      <Button btnSize={ButtonSize.Large} btnType={ButtonType.Primary}> Large test</Button>
      <Button btnSize={ButtonSize.Small} btnType={ButtonType.Primary}> Small test</Button>
      <Button btnType={ButtonType.Danger}>Danger test</Button>
      <Button   btnType={ButtonType.Link} href="www.fhj.com"> Link test</Button>
      <Button  disabled btnType={ButtonType.Link} href="www.fhj.com">disabled Link test</Button>
      <Button disabled> disabled test</Button>

      </header>
    </div>
  );
}

export default App;
